import {useState} from 'react';
const Home = () => {

    const [blogs,setBlogs]=useState([
        {title:'My new website', body:'lorem ipsum doratri cobaotp nati japeto.....',author:'mario',id:1},
        {title:'Welcome party!', body:'lorem ipsum doratri cobaotp nati japeto.....',author:'yoshi',id:2},
        {title:'Web dev tool tips', body:'lorem ipsum doratri cobaotp nati japeto.....',author:'tanyu',id:3},
    ]);

    return (
        <div className="Home">
            {blogs.map((blog)=>(
                <div className="blog-preview" key={blog.id}>
                    <h1>{blog.title}</h1>
                    <p>written by {blog.author}</p>
                </div>
            ))}
        </div>
    );
}

export default Home;
